<div class="single-article">
<header class="article-header">
<div class="article-details">
<span class="posted-on"><a href="http://wisladziecinow.pl/?p=1624" rel="bookmark"><time class="entry-date published updated" datetime="2019-04-24T21:58:19+00:00">Kwiecien 24, 2019</time></a></span>									</div>

<h1 class="entry-title"><a href="http://wisladziecinow.pl/?p=1624" rel="bookmark">Lider znow w Dziecinowie!</a></h1>		</header><!-- .article-header -->

<div class="entry-content article-content">
<p><strong><a href="http://wisladziecinow.pl/wp-content/uploads/2017/09/Kn023X5J.png" data-slb-active="1" data-slb-asset="1023384372" data-slb-internal="0" data-slb-group="1624"><img class="alignleft  wp-image-493" src="http://wisladziecinow.pl/wp-content/uploads/2017/09/Kn023X5J-300x300.png" alt="" width="175" height="175" srcset="http://wisladziecinow.pl/wp-content/uploads/2017/09/Kn023X5J-300x300.png 300w, http://wisladziecinow.pl/wp-content/uploads/2017/09/Kn023X5J-150x150.png 150w, http://wisladziecinow.pl/wp-content/uploads/2017/09/Kn023X5J-128x128.png 128w, http://wisladziecinow.pl/wp-content/uploads/2017/09/Kn023X5J-32x32.png 32w, http://wisladziecinow.pl/wp-content/uploads/2017/09/Kn023X5J.png 512w" sizes="(max-width: 175px) 100vw, 175px" /></a>Trener Lukasz Hass: </strong>Mecz jak zakladalismy byl bardzo ciezki. Wiedzielismy ze jeden gol moze zdecydowac o zwyciestwie i tak tez sie stalo. Kazdy zawodnik dal z siebie 100% i mozemy cieszyc sie z 3 punktow. Teraz pozostaje nam dalej ciezko pracowac na treningach i wygrywac. Bardzo dziekuje wszystkim zawodnikom i kibicom!</p>

</div><!-- .entry-content -->

</div>
</article><!-- #post-## -->


