<p><a href="http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o.jpg" data-slb-active="1" data-slb-asset="1505863424" data-slb-internal="0" data-slb-group="1601"><img class="alignleft wp-image-1137" src="http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o-223x300.jpg" alt="" width="150" height="202" srcset="http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o-223x300.jpg 223w, http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o-768x1035.jpg 768w, http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o-760x1024.jpg 760w, http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o-95x128.jpg 95w, http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o-24x32.jpg 24w, http://wisladziecinow.pl/wp-content/uploads/2018/09/40382451_240538269994716_7789740519277461504_o.jpg 1520w" sizes="(max-width: 150px) 100vw, 150px" /></a><strong>W 17 serii spotkan warszawskiej klasy A, czeka nas wyjazdowy pojedynek z CKS-em Celestynow. Nie ma co ukrywac, ze na tym terenie od zawsze gralo nam sie ciezko. Ciezko, to nawet malo powiedziane. Wedlug portalu 90minut.pl z Celestynowa jeszcze nigdy nie wywiezlismy kompletu punktow, a przynajmniej od 2001 roku, bo wtedy statystki sie urywaja. Wiadomo, ze kazda seria zawsze ma swoj koniec i wedlug slow piosenki Anny Jantar, ze nic nie moze przeciez wiecznie trwac, w niedziele interesuje nas tylko zwyciestwo!</strong> <a href="http://wisladziecinow.pl/?p=1601#more-1601" class="more-link">Continue reading <span class="screen-reader-text">&#8222;Zdobyc Celestynow!&#8221;</span> <span class="meta-nav">&rarr;</span></a></p>

