<div class="entry-content article-content">
<p><strong><a href="http://wisladziecinow.pl/wp-content/uploads/2017/09/zerzen.png" data-slb-active="1" data-slb-asset="1619990379" data-slb-internal="0" data-slb-group="1576"><img class="alignleft size-thumbnail wp-image-541" src="http://wisladziecinow.pl/wp-content/uploads/2017/09/zerzen-150x150.png" alt="" width="150" height="150" srcset="http://wisladziecinow.pl/wp-content/uploads/2017/09/zerzen-150x150.png 150w, http://wisladziecinow.pl/wp-content/uploads/2017/09/zerzen-300x300.png 300w, http://wisladziecinow.pl/wp-content/uploads/2017/09/zerzen-128x128.png 128w, http://wisladziecinow.pl/wp-content/uploads/2017/09/zerzen-32x32.png 32w, http://wisladziecinow.pl/wp-content/uploads/2017/09/zerzen.png 410w" sizes="(max-width: 150px) 100vw, 150px" /></a>Trener Lukasz Hass: </strong>Mecz ktory musielismy wygrac i to zrobilismy. Bylo to wazne spotkanie z punktu mentalnego przede wszystkim. Zagralismy tak jak tego sobie zyczylismy, zdobylismy kolejne punkty i to bylo dla nas najistotniejsze. Teraz skupiamy sie juz na kolejnym meczu. Dziekuje za gre swoim zawodnikom i kibicom za wsparcie. I wszystkim innym za motywacje jaka nam dajecie!</p>
<p><strong>Victoria Zerzen &#8211; Wisla Dziecinow 0:4 (0:2)<br />
</strong><strong>Bramki: </strong>Strzezek x2, Wiszniewski, Banasiewicz</p>

</div><!-- .entry-content -->

